import React from "react";
import "./Navbar.css";
import Logo from "../../Assets/logo.png";

const Navbar = () => {
  return (
    <div className="navbar-container">
      <div className="logo-sidebar">
        <img src={Logo} alt="logo" />
      </div>
      Navbar
    </div>
  );
};

export default Navbar;
